                    <table className=" divide-y-2 divide-gray-200 bg-transparent text-sm w-full mx-14">
                        <tbody className="divide-y divide-gray-200">
                        {
                            db.map(item => {
                                return (
                                    <tr key={item.name}>
                                        <td className="whitespace-nowrap px-4 py-2 font-medium text-gray-900">
                                            {item.name}
                                        </td>
                                        <td className="whitespace-nowrap px-4 py-2 text-gray-700 flex justify-center">{item.value}</td>
                                        <td className="whitespace-nowrap px-4 py-2">
                                            <a
                                                href="#"
                                                className="inline-block rounded bg-indigo-600 px-4 py-2 text-xs font-medium text-white hover:bg-indigo-700"
                                            >
                                                refactor
                                            </a>
                                        </td>
                                    </tr>
                                )
                            })
                        }
                        </tbody>
                    </table>
                </div>
                <div className="text-center text-5xl w-full">
                    Ваши объявления
                </div>
                <div className="w-4/5 flex flex-wrap">
                    {
                        listOfAdverts.map((index, index1) => {
                            if(index1 < 10) {
                                return <Advert key={index1} index={index}/>
                            }
                        })
                    }
                </div>
            </div>
        </div>
    );
}

